import React, { useState, useEffect } from "react";
import styled from "styled-components";
import axios from "axios";
import { FaTrash, FaEdit, FaPlus, FaCarAlt } from "react-icons/fa";

// Styled Components
const GarageContainer = styled.div`
  padding: 20px;
  color: white;
`;

const Header = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 20px;
`;

const Button = styled.button`
  background-color: #007bff;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 4px;
  cursor: pointer;

  &:hover {
    background-color: #0056b3;
  }
`;

const CarsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 20px;
`;

const CarCard = styled.div`
  background: rgba(255, 255, 255, 0.2);
  border-radius: 8px;
  padding: 20px;
  position: relative;
  text-align: center;
  transition: transform 0.3s;

  &:hover {
    transform: translateY(-5px);
  }

  &:hover div {
    display: flex;
  }
`;

const CarImage = styled.img`
  width: 100%;
  height: 120px;
  object-fit: cover;
  border-radius: 4px;
  margin-bottom: 10px;
`;

const DefaultIcon = styled(FaCarAlt)`
  font-size: 80px;
  color: white;
  margin-bottom: 10px;
`;

const CarDetails = styled.div`
  text-align: left;
`;

const CarActions = styled.div`
  position: absolute;
  top: 10px;
  right: 10px;
  display: none;
  flex-direction: column;
  gap: 5px;

  button {
    background: rgba(0, 0, 0, 0.6);
    border: none;
    border-radius: 4px;
    color: white;
    padding: 5px 10px;
    cursor: pointer;

    &:hover {
      background: rgba(0, 0, 0, 0.8);
    }
  }
`;

const Modal = styled.div`
  background: rgba(0, 0, 0, 0.8);
  padding: 20px;
  border-radius: 8px;
  color: white;
`;

function Garage() {
  const [cars, setCars] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [formData, setFormData] = useState({ make: "", model: "", category: "", image: "" });
  const [editCarId, setEditCarId] = useState(null);

  const fetchCars = async () => {
    const response = await axios.get("http://localhost:5000/cars");
    setCars(response.data);
  };

  useEffect(() => {
    fetchCars();
  }, []);

  const handleAddCar = async (e) => {
    e.preventDefault();
    if (editCarId) {
      await axios.put(`http://localhost:5000/cars/${editCarId}`, formData);
    } else {
      await axios.post("http://localhost:5000/cars", formData);
    }
    setFormData({ make: "", model: "", category: "", image: "" });
    setEditCarId(null);
    setIsModalOpen(false);
    fetchCars();
  };

  const handleDeleteCar = async (id) => {
    await axios.delete(`http://localhost:5000/cars/${id}`);
    fetchCars();
  };

  const handleEditCar = (car) => {
    setFormData(car);
    setEditCarId(car._id);
    setIsModalOpen(true);
  };

  return (
    <GarageContainer>
      <Header>
        <h2>Garage</h2>
        <Button onClick={() => setIsModalOpen(true)}>
          <FaPlus /> Add Car
        </Button>
      </Header>

      <CarsGrid>
        {cars.map((car) => (
          <CarCard key={car._id}>
            {car.image ? <CarImage src={car.image} alt={car.make} /> : <DefaultIcon />}
            <CarDetails>
              <p><strong>Make:</strong> {car.make}</p>
              <p><strong>Model:</strong> {car.model}</p>
              <p><strong>Category:</strong> {car.category}</p>
            </CarDetails>
            <CarActions>
              <button onClick={() => handleEditCar(car)}><FaEdit /></button>
              <button onClick={() => handleDeleteCar(car._id)}><FaTrash /></button>
            </CarActions>
          </CarCard>
        ))}
      </CarsGrid>

      {isModalOpen && (
        <Modal>
          <h3>{editCarId ? "Edit Car" : "Add Car"}</h3>
          <form onSubmit={handleAddCar}>
            <input
              type="text"
              placeholder="Make"
              value={formData.make}
              onChange={(e) => setFormData({ ...formData, make: e.target.value })}
              required
            />
            <input
              type="text"
              placeholder="Model"
              value={formData.model}
              onChange={(e) => setFormData({ ...formData, model: e.target.value })}
              required
            />
            <input
              type="text"
              placeholder="Category"
              value={formData.category}
              onChange={(e) => setFormData({ ...formData, category: e.target.value })}
              required
            />
            <input
              type="text"
              placeholder="Image URL (optional)"
              value={formData.image}
              onChange={(e) => setFormData({ ...formData, image: e.target.value })}
            />
            <Button type="submit">{editCarId ? "Save Changes" : "Add Car"}</Button>
          </form>
          <Button onClick={() => setIsModalOpen(false)}>Close</Button>
        </Modal>
      )}
    </GarageContainer>
  );
}

export default Garage;
